import './App.css';
import Sandwich from './modules/Sandwich';
import Navbar from './modules/Navbar';
import Home from './pages/Home';
import AllModules from './pages/AllModules';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        Ethical AI for Computational Action
      </header>
      <Navbar/>
      <Router>
        <Home/>
        <AllModules/>
      </Router>
    </div>
  );
}

export default App;
